import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import WelcomePage from './WelcomePage';
import InstructionsPage from './InstructionsPage';
import ImageProcessingPage from './ImageProcessingPage';

function App() {
  return (
    <Router>
      <div>
        <h1>Chào mừng đến với ứng dụng giảm nhiễu ảnh</h1>
        <nav>
          <ul>
            <li>
              <Link to="/instructions">Hướng dẫn sử dụng</Link>
            </li>
            <li>
              <Link to="/image-processing">Bắt đầu</Link>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route path="/instructions">
            <InstructionsPage />
          </Route>
          <Route path="/image-processing">
            <ImageProcessingPage />
          </Route>
          <Route path="/">
            <WelcomePage />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
